#toolConsult {
  position: absolute;
  width: 300px;
  height: 300px;
  top: 50%;
  right: 50px;
  transform: translate(0, -50%);
  background: gray;
  box-shadow: 0 0 5px #999;
  cursor: default;
  border-radius: 5px;

  .container {
    width: 94%;
    height: 88%;
    margin: 0 auto;
    margin-top: 9%;
    background-color: #ffffff;
    border-radius: inherit;

    .chatBox {
      height: 60%;
      overflow: auto;

      ul {
        list-style: none;
        padding: 0 10px 0 10px;

        .msgFrom {
          font-weight: 800;
        }

        .msgTime {
          margin-left: 10px;
          color: #aaa;
        }
      }
    }

    .chatInput {
      height: 30%;
      resize: none;
    }

    .chatSend {
      height: 10%;
      float: right;
    }
  }
}

#closeIcon {
  width: 20px;
  height: 20px;
  position: absolute;
  right: 5px;
  top: 5px;
  cursor: pointer;
}

.consultAnim-enter,
.consultAnim-leave-to {
  opacity: 0;
}

.consultAnim-enter-active,
.consultAnim-leave-active {
  transition: 0.2s;
}

.consultAnim-enter-to,
.consultAnim-leave {
  opacity: 1;
}
